(1, 1, 1, 'BOLPEGAS S.R.L. CREA UNIDAD DE NEGOCIOS', '', 'Con el objetivo de fomentar y generar nuevas oportunidades de trabajo y diversificar sus actividades, Bolpegas ahora cuenta con una Unidad de Negocios. EstÃ¡ conformada por los ingenieros Luis Mantilla como Jefe de la Unidad, Jorge Flores como asesor y Roberto OrdoÃ±ez como profesional especialista. Todos ellos con vasta experiencia y conocimientos en el sector de hidrocarburos.', '<p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\">Con el objetivo de fomentar y generar nuevas oportunidades de trabajo y diversificar sus actividades, Bolpegas ahora cuenta con una Unidad de Negocios. EstÃ¡ conformada por los ingenieros Luis Mantilla como Jefe de la Unidad, Jorge Flores como asesor y Roberto OrdoÃ±ez como profesional especialista. Todos ellos con vasta experiencia y conocimientos en el sector de hidrocarburos.<br><br></span><span lang=\"ES\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\">Esta unidad se encargarÃ¡ de manejar las relaciones con empresas asociadas y representadas y promover actividades que permitan incrementar la cartera de servicios que Bolpegas pretende ofrecer a sus clientes.</span><span lang=\"ES\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\"><br>Siete empresas de renombre internacional ya forman parte de estas nuevas oportunidades de trabajo y se proyecta trabajar conjuntamente con ellas.Â </span><span lang=\"EN-US\">Estas son: Georadar, Neuman&Esser/Neac, IX Power, LiftOil, Open Geophysical, Nord-West-Geofields y Alpina.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\"><br>Georadar es una empresa brasilera especializada en el Ã¡rea de adquisiciÃ³n sÃ­smica y servicios de geofÃ­sica, geologÃ­a, geotecnia, sÃ­smica de pozos, geoquÃ­mica de superficie, microsÃ­smica, recuperaciÃ³n ambiental, anÃ¡lisis de laboratorios y otros servicios relacionados.</span><span lang=\"ES\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\">Â </span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\">La empresa alemana Neuman&Esser/ Neac tiene oficinas en Brasil para AmÃ©rica Latina y provee compresores reciprocantes, ingenierÃ­a y mantenimiento.</span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\"><br></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\">La empresa estadounidense IX Power, representada en AmÃ©rica Latina por la Empresa TILSA, estÃ¡ especializada en la fabricaciÃ³n y provisiÃ³n de plantas para el tratamiento de aguas de producciÃ³n de hidrocarburos y tratamiento de aguas industriales.</span><span lang=\"ES\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\"><br>LiftOil, empresa franco argentina con base en PerÃº, provee Equipos especializados para pozos de petrÃ³leo agotados, reemplazo de unidades de bombeo mecÃ¡nico o bombas de profundidad para mejorar la producciÃ³n.</span><span lang=\"ES\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\"><br>Nord-West, empresa rusa representada por la empresa Geofields para AmÃ©rica Latina, realiza trabajos especializados en registros magnetotelÃºricos, procesamiento de datos, servicios de interpretaciÃ³n y exploraciÃ³n geotÃ©rmica.</span><span lang=\"ES\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\"><br>Open Geophysical, empresa estadounidense, suministra software altamente especializado para geofÃ­sica; diseÃ±o y desarrollo de innovador e interactivo de procesamiento por lotes; visualizaciÃ³n y anÃ¡lisis de datos en un paquete integral; procesamiento en tiempo terrestre y marino y disponibilidad de imÃ¡genes en profundidad.</span><span lang=\"ES\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\"><br>Alpina es una empresa brasilera fabrica que torres de enfriamiento de agua para procesos industriales.</span><span lang=\"ES\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\"></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\"><br>Estas oportunas alianzas de Bolpegas amplÃ­an y diversifican nuestros servicios. AsÃ­, generan nuevas oportunidades de negocios y expansiÃ³n hacia nuevos sectores petroleros e industriales.</span></p>', '2016-03-03', 'bolpegas-srl-crea-unidad-de-negocios.html', 'BOLPEGAS', 0, 0, 0, 0, '5772c971c281b.png', 1, 1),
