ize: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\"><br></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\">La empresa estadounidense IX Power, representada en AmÃ©rica Latina por la Empresa TILSA, estÃ¡ especializada en la fabricaciÃ³n y provisiÃ³n de plantas para el tratamiento de aguas de producciÃ³n de hidrocarburos y tratamiento de aguas industriales.</span><span lang=\"ES\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\"><br>LiftOil, empresa franco argentina con base en PerÃº, provee Equipos especializados para pozos de petrÃ³leo agotados, reemplazo de unidades de bombeo mecÃ¡nico o bombas de profundidad para mejorar la producciÃ³n.</span><span lang=\"ES\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\"><br>Nord-West, empresa rusa representada por la empresa Geofields para AmÃ©rica Latina, realiza trabajos especializados en registros magnetotelÃºricos, procesamiento de datos, servicios de interpretaciÃ³n y exploraciÃ³n geotÃ©rmica.</span><span lang=\"ES\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\"><br>Open Geophysical, empresa estadounidense, suministra software altamente especializado para geofÃ­sica; diseÃ±o y desarrollo de innovador e interactivo de procesamiento por lotes; visualizaciÃ³n y anÃ¡lisis de datos en un paquete integral; procesamiento en tiempo terrestre y marino y disponibilidad de imÃ¡genes en profundidad.</span><span lang=\"ES\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\"><br>Alpina es una empresa brasilera fabrica que torres de enfriamiento de agua para procesos industriales.</span><span lang=\"ES\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\"></span></p><p class=\"MsoNormal\" style=\"margin: 3pt 0cm; line-height: 21.4286px; vertical-align: baseline; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"><span lang=\"ES\"><br>Estas oportunas alianzas de Bolpegas amplÃ­an y diversifican nuestros servicios. AsÃ­, generan nuevas oportunidades de negocios y expansiÃ³n hacia nuevos sectores petroleros e industriales.</span></p>', '2016-03-03', 'bolpegas-srl-crea-unidad-de-negocios.html', 'BOLPEGAS', 0, 0, 0, 0, '5772c971c281b.png', 1, 1),
(2, 1, 1, 'CERTIFICACIÃ“N ISO POR MÃS DE UNA DÃ‰CADA', '', 'Desde hace 12 aÃ±os todas las actividades de BOLPEGAS se desarrollan con el sello de la certificaciÃ³n TÃœV Rheinland (normas ISO-9001). Hace 6 aÃ±os integramos nuestro sistema de gestiÃ³n para certificar tambiÃ©n en las normas ISO-14001 y BS-OHSAS-18001.', '<p class=\"MsoNormal\" style=\"line-height: 21.4286px;\"><span lang=\"ES\">Desde hace 12 aÃ±os todas las actividades de BOLPEGAS se desarrollan con el sello de la certificaciÃ³n TÃœV Rheinland (normas ISO-9001). Hace 6 aÃ±os integramos nuestro sistema de gestiÃ³n para certificar tambiÃ©n en las normas ISO-14001 y BS-OHSAS-18001.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 21.4286px;\"><span lang=\"ES\">En este sentido, es muy grato para nosotros anunciar que una vez mÃ¡s hemos logrado aprobar la auditorÃ­a, realizada el 3 y 4 de agosto, para obtener la re-certificaciÃ³n.Â Esta auditorÃ­a verifica el cumplimiento de todos los requisitos exigidos por norma y el uso del manual de gestiÃ³n -que consiste en un grupo de procedimientos que rigen nuestras actividades.Â <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 21.4286px;\"><span lang=\"ES\">â€œEn Bolpegas contamos con procedimientos para el control de documentos, control de registros, auditorÃ­as internas y tratamiento de no conformidades. Estos son los procedimientos bÃ¡sicos de la norma de calidad. Sumado a eso, Bolpegas, en su sistema de gestiÃ³n, tiene un sin fin de procedimientos internos. Por ejemplo, el Ã¡rea de administraciÃ³n tiene sus procedimientos propios como tambiÃ©n fiscalizaciÃ³n e ingenierÃ­a los tienen. Eso nos favoreciÃ³ durante la auditorÃ­a pues este aÃ±o vinieron cinco auditores entre los cuales participÃ³ un abogado que se encarga de verificar el cumplimiento de las exigencias legales del Estado boliviano. Fue una auditoria exhaustiva, pero lo hemos logradoâ€, resaltÃ³ Luis Mantilla, Gerente de Calidad y SMS.Â â€œPara nosotros es un orgullo certificar desde el 2003. Empezamos con la obtenciÃ³n del certificado de calidad segÃºn la norma de calidad ISO-9001 y despuÃ©s, a partir del 2009,Â tenemos certificados para calidad, seguridad y medio ambienteâ€, finalizÃ³ Mantilla.Â <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 21.4286px;\"><span lang=\"ES\">La polÃ­tica de calidad, seguridad, medio ambiente y salud ocupacional deÂ BOLPEGAS es entregar a sus clientes obras y/o servicios con una calidad que estÃ© de acuerdo con los diseÃ±os suministrados y los requerimientos contractuales dentro de los costos y tiempos pactados y que cumplan con las normas tÃ©cnicas, requisitos legales y de otro tipo.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: 21.4286px;\"><span lang=\"ES\">Para hacer realidad esta polÃ­tica, la Gerencia de la compaÃ±Ã­a ha decidido desarrollar un Sistema Integrado de GestiÃ³n de Calidad, Seguridad, Medio Ambiente y Salud Ocupacional, siguiendo los lineamientos indicados en las normas vigentesÂ ISO-9001:2008,Â OHSAS 18001:2007Â eÂ ISO-14001:2004. Este debe ser aplicado tanto en las actividades cotidianas de la empresa como en los servicios que la misma presta a sus clientes.</span></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '2016-02-18', 'certificacin-iso-por-ms-de-una-dcada.html', 'BOLPEGAS', 0, 0, 0, 0, '5772cf3bbf290.jpg', 1, 0),
