(3, 1, 'Contacto', 'contacto.html', 'contacto, wicom', 'Es una empresa de tecnologÃ­a en telecomunicaciones especializada en video y broadcasting, integramos soluciones tecnolÃ³gicas capaces de cubrir con las necesidades de las empresas, para apoyar las estrategias y procesos informÃ¡ticos de los negocios', '<p><br></p>', NULL, 0, 'contact', '', 1),
