(4, 1, 'Acerca de', 'acerca-de.html', '---', '---', '<h2><strong>WICOM</strong></h2>\r\n\r\n<p>Es una empresa de tecnolog&iacute;a en telecomunicaciones especializada en video y broadcasting, integramos soluciones tecnol&oacute;gicas capaces de cubrir con las necesidades de las empresas, para apoyar las estrategias y procesos inform&aacute;ticos de los negocios asociados.</p>\r\n\r\n<p>Prestamos servicios principalmente a empresas proveedoras de servicios de telecomunicaciones, as&iacute; como a clientes corporativos, organizaciones gubernamentales y no gubernamentales; y a empresas e instituciones que utilizan tecnolog&iacute;a avanzada para el desarrollo de su trabajo.</p>\r\n\r\n<p>Hemos conformado una planta de profesionales altamente calificados y certificados en telecomunicaciones y servicio de video.</p>\r\n\r\n<h2><strong>HISTORIA</strong></h2>\r\n\r\n<p>WICOM es una empresa establecida en 2012, dedicada en la actualidad a la provisi&oacute;n de tecnolog&iacute;a en telecomunicaciones especializada en video y broadcasting. Es uno de los mayores proveedores de soluciones a operadores de telecomunicaci&oacute;n, en diferentes &aacute;reas.</p>\r\n', NULL, 0, 'about', '5cf8890d1a225.jpg', 1),
(4, 7, 'Acerca de', 'acerca-de.html', 'tecnologÃ­a, telecomunicaciones, broadcasting, tecnolÃ³gicas', 'Es una empresa de tecnologÃ­a en telecomunicaciones especializada en video y broadcasting, integramos soluciones tecnolÃ³gicas capaces de cubrir con las necesidades de las empresas, para apoyar las estrategias y procesos informÃ¡ticos de los negocios', '<h2><strong>WICOM</strong></h2>\r\n\r\n<p>Es una empresa de tecnolog&iacute;a en telecomunicaciones especializada en video y broadcasting, integramos soluciones tecnol&oacute;gicas capaces de cubrir con las necesidades de las empresas, para apoyar las estrategias y procesos inform&aacute;ticos de los negocios asociados.</p>\r\n\r\n<p>Prestamos servicios principalmente a empresas proveedoras de servicios de telecomunicaciones, as&iacute; como a clientes corporativos, organizaciones gubernamentales y no gubernamentales; y a empresas e instituciones que utilizan tecnolog&iacute;a avanzada para el desarrollo de su trabajo.</p>\r\n\r\n<p>Hemos conformado una planta de profesionales altamente calificados y certificados en telecomunicaciones y servicio de video.</p>\r\n\r\n<h2><strong>HISTORIA</strong></h2>\r\n\r\n<p>WICOM es una empresa establecida en 2012, dedicada en la actualidad a la provisi&oacute;n de tecnolog&iacute;a en telecomunicaciones especializada en video y broadcasting. Es uno de los mayores proveedores de soluciones a operadores de telecomunicaci&oacute;n, en diferentes &aacute;reas.</p>\r\n', NULL, 0, 'about', '5cf889198c0c0.jpg', 1),
(5, 1, 'Soluciones', 'soluciones.html', '--', '--', '<h2>Wicom</h2>\r\n\r\n<p>Cuenta con un amplio Know-how compuesto por servicios de telecomunicaciones especializada en video y broadcasting dirigida a operadores, proveedores y fabricantes de tecnolog&iacute;a que requieran soluciones a la medida de sus necesidades.</p>\r\n', NULL, 0, 'services', '5cf883b5c8cef.jpg', 1),
(5, 7, 'Soluciones', 'soluciones.html', '--', '--', '<h2>Wicom</h2>\r\n\r\n<p>Cuenta con un amplio Know-how compuesto por servicios de telecomunicaciones especializada en video y broadcasting dirigida a operadores, proveedores y fabricantes de tecnolog&iacute;a que requieran soluciones a la medida de sus necesidades.</p>\r\n', NULL, 0, 'services', '5cf883bdab1f4.jpg', 1),
(6, 1, 'Noticias', 'noticias.html', '-', '-', '', NULL, 0, 'news', '', 1),
(6, 7, 'Noticias', 'noticias.html', '-', '-', '', NULL, 0, 'news', '', 1),
(7, 1, 'Partners', 'partners.html', 'Partners', 'Partners', '<p style=\"text-align:center\">Al ser una empresa enfocada en ofrecer tecnolog&iacute;a en telecomunicaciones especializada en video y broadcasting, somos partners de empresas prestigiosas reconocidas a nivel mundial, de este modo nos comprometemos a ofrecer la mayor calidad para solucionar las necesidades de nuestros clientes.</p>\r\n', 'Al ser una empresa enfocada en ofrecer tecnologÃ­a en telecomunicaciones especializada en video y broadcasting, somos partners de empresas prestigiosas reconocidas a nivel mundial, de este modo nos comprometemos a ofrecer la mayor calidad para soluci', 0, 'partners', '', 1),
(7, 7, 'Partners', 'partners.html', 'Partners', 'Partners', '<p style=\"text-align:center\">Al ser una empresa enfocada en ofrecer tecnolog&iacute;a en telecomunicaciones especializada en video y broadcasting, somos partners de empresas prestigiosas reconocidas a nivel mundial, de este modo nos comprometemos a ofrecer la mayor calidad para solucionar las necesidades de nuestros clientes.</p>\r\n', 'Al ser una empresa enfocada en ofrecer tecnologÃ­a en telecomunicaciones especializada en video y broadcasting, somos partners de empresas prestigiosas reconocidas a nivel mundial, de este modo nos comprometemos a ofrecer la mayor calidad para soluci', 0, 'partners', '', 1),
